import React from 'react';

import WeeklySchedule from './WeeklySchedule.jsx';
import PacmanLoad from 'react-spinners/PacmanLoader';

import { readString } from 'react-papaparse';

import './Scheduler.scss';

export default class Scheduler extends React.Component {
    constructor(props) {
        super(props);

        this.courses     = props.courses;
        this.instructors = props.instructors;

        this.state = {
            schedule: null
        };
    }

    componentDidMount() {
        //console.log( this.courses );
        this.run_scheduler();
    }

    run_scheduler() {
        let reader = new FileReader();
        reader.onload = function(e) {
            //console.log( reader.result );
            const result = readString( reader.result );
            console.log( result );
        };
        reader.readAsText(this.courses);

        window.pypyjs.ready().then(function() {
            return window.pypyjs.execfile('../../main.py');
        }).then(function() {
            return window.pypyjs.get('x');
        }).then(function(result) {
            console.log(result);
        });
    }

    render() {
        return (
            <>
                { this.state.schedule ?

                    <WeeklySchedule schedule = {this.state.schedule} />

                :

                    <div className="sv-loading">
                        <PacmanLoad size='50px' color='white' />
                    </div>
                }
            </>
        );
    }
}
